import Nam1 from "./image/anh1.jpg";
import Nam2 from "./image/anh2.jpg";
function App() {
  return (
    <div className=" justify-center">
      <Anh1 />
      <Anh2 />
    </div>
  );
}

const Anh1 = () => {
  return (
    <div
      className="bg-no-repeat bg-center"
      style={{
        backgroundImage: `url(${Nam1})`,
        width: "auto", // Kích thước theo tỉ lệ ảnh
        height: "auto",
        aspectRatio: "auto", // Giữ tỉ lệ khung hình nếu trình duyệt hỗ trợ
      }}
    ></div>
  );
};

const Anh2 = () => {
  return (
    <div
      className="   bg-center bg-cover "
      style={{ backgroundImage: `url(${Nam2})` }}
    ></div>
  );
};
export default App;
